INSERT INTO `tests` (`id`, `test_name`, `cate_id`, `product_model`, `test_sku`, `test_biomarker`, `product_description`, `description`, `procedure`, `side_effects`, `price`, `is_featured`, `product_unit`, `weights`, `brand_id`, `sort_id`, `status`, `template_type`, `meta_title`, `meta_keyword`, `meta_description`, `added_on`, `last_updatedon`, `added_by`, `image_url`, `image_banner`, `banner_link`, `prd_type`, `is_reorder`, `product_code`, `add_on_products`, `is_addon`, `created_at`, `practitioner_id`) VALUES
(3, 'Basic Health', '4', '', 'DL1', 'Kidney, Liver, Proteins, Uric Acid, Iron TIBC, ', '<div class=\"team-item\">\r\n<h3>Information</h3>\r\n<p>The basic health check is the place to begin building up a picture of your health over time. It looks at key biomarkers for liver and kidney condition,&nbsp; HBA1C for diabetes and also tests for bone health, gout and iron.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>Who is this test for?</h3>\r\n<p>The basic health check is ideal for those who are interested in finding their baseline levels, It is recommended to use this test at regular intervals for continued monitoring to confirm consistency in the readings</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>What Next?</h3>\r\n<p>If you have any results out of the normal range we recommend you consult a doctor just to be sure that everything is ok.</p>\r\n</div>', 'baseline levels Kidney, Liver, Proteins, Uric Acid, Iron TIB', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup> class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '29', 'No', 'in_gm', 'Fingerprick/Venous, 14 Biomarkers', 0, 0, 'Active', 'new_custom', 'DL1 health check,test', 'Basic health check, blood test, liver, kidneys, check blood, health, wellness, fitness,test', 'The basic health check is ideal for those who are interested in finding their baseline levels, It is recommended to use this test at regular test intervals', '1491553419', '1617864106', 1, '', 'csrippvt1405dpvelmhg.png', '', 'Blood Test', 'no', 'DL1', '189,190,187,188,191,192,186,193', 'no', '2022-04-13 23:33:32', NULL),
(5, 'Male Hormone profile', '6', '', 'MIPR2', 'Testosterone, SHBG, Prolactin, F test Calc, FSH, LH OEST FAI', '<div class=\"team-item\">\r\n<h3>Information</h3>\r\n<p>The male hormone profile&nbsp;is a test for key markers in your blood to help you monitor and manage your testosterone therapy. Whilst testosterone can have a positive impact on strength, libido, sexual performance and mood, there are also risks to your health, especially if taken to excess. The test looks at testosterone, free testosterone, oestradiol, prolactin and SHBG.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>Who Can Take The Test?</h3>\r\n<p>The&nbsp;male hormone profile test is for people that are about to begin or have been taking testosterone replacement therapy for approximately 3-6 months, If you want to monitor your hormones this test is recommended.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>What Happens Next?</h3>\r\n<p>If you wish to continue on testosterone therapy treatment you should book for a further consultation and present the results of this test to the doctor for interpretation.</p>\r\n</div>', '8 Tests which will include Testosterone, SHBG, Prolactin, F test Calc, FSH, LH OEST FAI', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup> class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '90', 'No', 'in_gm', '', 0, 0, 'Active', 'default', 'Male Hormone profile', 'Male Hormone profile', 'The male hormone profile is a test for key markers in your blood to help you monitor and manage your testosterone therapy.', '1491554123', '1617864118', 1, '', 'i37gysvhn5mhsqdvw6bq.png', '', 'Blood Test', 'yes', 'MIPR2', '0', 'no', '2022-04-13 23:33:32', NULL),
(7, 'Menopause Profile', '7', '', 'YR020', 'FSH, LH, Oest, Prol, Progesterone, Cortisol, Testosterone, FT4 TSH, Vit B12, DHEAS', '<div class=\"sec-title mb20\">\r\n<h2>Information</h2>\r\n</div>\r\n<div class=\"team-item\">\r\n<p>Hormones are involved in all of your body&rsquo;s functions. Women&rsquo;s sex hormones control the reproductive system and an imbalance may affect fertility and the menstrual cycle. Changes can also be connected to menopause. Having your blood checked s the best way to know why you are feeling the way you are.&nbsp;</p>\r\n<h3>The hormone check tests for:</h3>\r\n<ul>\r\n<li>luteinizing hormone, (reproductive system)</li>\r\n<li>follicle-stimulating hormone, (egg production and the menstrual cycle)</li>\r\n<li>oestradiol (ovarian function)&nbsp;</li>\r\n<li>prolactin (determine if you are menstruating)</li>\r\n<li>Testosterone&nbsp;</li>\r\n<li>DHEA\'S</li>\r\n<li>TSH (thyroid&nbsp;</li>\r\n<li>FT4&nbsp;&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>Who Should Take This Test?</h3>\r\n<p>This test is for women hoping to check on specific hormones that may have an effect on their fertility, menstrual cycle and menopause. - It is a very comprehensive test for menopause, it checks markers to see if you are in menopause But is also checks the markers you need to start clinical intervention if needed. This is a full hormone analysis.&nbsp;</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>What Next</h3>\r\n<p>If you have any results out of the normal range we recommend you consult a doctor just to be sure that everything is ok,</p>\r\n<p>If you have any questions or queries relating to this we recommend you consult a doctor for further assistance</p>\r\n</div>', 'FSH, LH, Oest, Prol, Progesterone, Cortisol, Testosterone, FT4 TSH, Vit B12, DHEAS', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup> class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '150', 'No', 'in_gm', '', 0, 0, 'Active', 'default', 'Hormone check', 'Hormone check', 'Hormones are involved in all of your bodys functions. Womens sex hormones control the reproductive system and an imbalance may affect fertility', '1491555758', '1599839307', 1, '', '', '', 'Blood Test', 'yes', 'YR020', '0', 'no', '2022-04-13 23:33:32', NULL),
(8, 'Female hormone check', '7', '', 'FIP', 'FSH, Oest, Prolactin, LH ', '<div class=\"sec-title mb20\">\r\n<h2>Information</h2>\r\n</div>\r\n<div class=\"team-item\">\r\n<p>The basic womens profile test will take a glimpse at all your essential hormone markers including Follicle Stimulating Hormone, important for women in the production of eggs&nbsp; oestadiolin levels which can be the cause of can cause acne, constipation loss of sex drive and depression and Progesterone it helps prepare your body for conception and pregnancy and regulates the monthly menstrual cycle. It also plays a role in sexual desire</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>Who Is This Test For?</h3>\r\n<p>The general health check is designed for women of any age, It is a good starting point for young and old for establishing base levels for many important health markers.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>What Next</h3>\r\n<p>If you have any results out of the normal range we recommend you consult a doctor just to be sure that everything is ok.</p>\r\n<p>If you have any questions or queries relating to this we recommend you consult a doctor for further assistance</p>\r\n</div>', '4 tests included, FSH, Oest, Prolactin, LH ', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup> class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '80', 'No', 'in_gm', 'Finger-prick blood sample', 0, 0, 'Active', 'default', 'female hormone check', 'female hormone check', 'female hormone check', '1491555971', '1612780360', 1, '', '', '', 'Blood Test', 'yes', 'FIP', '0', 'no', '2022-04-13 23:33:32', NULL),
