(12, 'Cortisol', '4', '', 'CORT', 'cortisol', '<h3>Information</h3>\r\n<p>A cortisol test is done to measure the level of the hormone cortisol in the blood, which may indicate problems with the adrenal glands or pituitary gland&nbsp;It&rsquo;s your body&rsquo;s main stress hormone. It works with certain parts of your brain&nbsp;to control your mood, motivation, and fear.</p>\r\n<p>cortisol plays an important role in a number of things your body does. For example, it:</p>\r\n<ul>\r\n<li>Manages how your body uses carbohydrates, fats, and proteins</li>\r\n<li>Keeps inflammation&nbsp;down</li>\r\n<li>Regulates your blood pressure</li>\r\n<li>Increases your blood sugar&nbsp;(glucose)</li>\r\n<li>Controls your sleep/wake cycle</li>\r\n<li>Boosts energy so you can handle stress and restores balance afterward</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3>Who is this test for?</h3>\r\n<p>This test is for anyone wanting a check their cortisol levels to assess adrenal function.&nbsp;</p>\r\n<h3>What Next?</h3>\r\n<p>If you have any results out of the normal range we recommend you consult a doctor just to be sure that everything is ok.</p>', 'This test measure the level of  cortisol in the blood, which may indicate problems with the adrenal glands or pituitary gland', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup> class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '29', 'No', 'in_gm', 'Fingerprick/ Venous, 1 Biomarker', 0, 0, 'Active', 'new_custom', 'Cortisol', 'Cortisol', 'A cortisol test is done to measure the level of the hormone cortisol in the blood, which may indicate problems with the adrenal glands or pituitary gland', '1495444937', '1620724951', 1, '', '', '', 'Blood Test', 'yes', 'CORT+', '0', 'no', '2022-04-13 23:33:32', NULL),
(13, 'Progesterone', '7', '', 'PROG', 'progesterone', '<p>The Progesterone Test measures the amount of the hormone in your blood. Progesterone is a female hormone produced by the ovaries and it&rsquo;s essential for pregnancy. It prepares the uterus for fertilization and produces breast milk.</p>', 'This Test measures the amount of Progesterone in your blood it is a female hormone produced by the ovaries...', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup> class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '40', 'No', 'in_gm', 'Fingerprick/Venous,1 Biomarker', 0, 0, 'Active', 'new_custom', 'Progesterone', 'Progesterone', 'The Progesterone Test measures the amount of the hormone in your blood. Progesterone is a female hormone produced by the ovaries...', '1495445381', '1615977819', 1, '', '', '', 'Blood Test', 'yes', 'PROG+', '0', 'no', '2022-04-13 23:33:32', NULL),
(14, 'Oestradiol', '7', '', 'OEST', 'oestradiol', '<p>Oestradiol is a steroid hormone that&nbsp;accounts for 80% of the oestrogen in the female body. It is secreted by the ovaries and is responsible for the development and maintenance of reproductive structures, including fat distribution, preparing the follicle in the ovary for the release of an egg&nbsp;and helping to maintain bone density. This blood test measures the level&nbsp;of oestradiol in your body.</p>', 'Oestradiol is a steroid hormone that accounts for 80% of the oestrogen in the female body.', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup> class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '29', 'No', 'in_gm', 'Fingerprick/Venous, 1Biomarker', 0, 0, 'Active', 'new_custom', 'Oestradiol', 'Oestradiol', 'Oestradiol is a steroid hormone that accounts for 80% of the oestrogen in the female body.', '1495445601', '1615977705', 1, '', '', '', 'Blood Test', 'yes', 'OEST', '0', 'no', '2022-04-13 23:33:32', NULL),
(113, 'Cholesterol Check', '4', '', 'LIPP', 'cholesterol- Triglycerides, HDL LDL and non HDL', '<div class=\"team-item\">\r\n<h3>Information</h3>\r\n<p>This test measures all the various types of cholesterol in your blood.<br /><br /> LDL cholesterol builds up on your artery walls and hardens then over time narrows the arteries and increases your risk of heart disease.<br /><br /> HDL cholesterol can help stop this narrowing by taking bad cholesterol and sending it through the liver. So therefore, healthy cholesterol levels would consist of low levels of LDL cholesterol and high level of HDL cholesterol.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>Who Can Take The Test?</h3>\r\n<p>This test is for&nbsp;those&nbsp;looking to check on their cholesterol.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>What Happens Next?</h3>\r\n<p>Using the results of this test along with your personal information you provided a doctor should be able to diagnose and treat anyone with a deficiency in testosterone.</p>\r\n</div>', 'This test measures all the various types of cholesterol in your blood.For example HDL LDL and non HDL', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup> class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '29', 'No', 'in_gm', '5 Biomarkers,Fingerprick/ Venous', 0, 0, 'Active', 'new_custom', 'Cholesterol Check', 'Cholesterol, lipids, blood test, finger prick kit, hIGH cHOLESTEROL', 'This test measures all the various types of cholesterol in your blood.', '1507214831', '1615977762', 1, '', '', '', 'Blood Test', 'yes', 'LIPP', '0', 'no', '2022-04-13 23:33:32', NULL),
(127, 'DL6LT', '12', '', 'YR018', 'Liver and Kidney,  Full blood count, Cholesterol ,Thyroid, Testosterone', '<div class=\"team-item\">\r\n<h3>Information</h3>\r\n<p>The&nbsp;DL6LT is the place to begin building up a picture of your health over time. It looks at key biomarkers for liver and kidney condition,&nbsp; HBA1C for diabetes and also tests for bone health, gout, iron and testosterone.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>Who is this test for?</h3>\r\n<p>The&nbsp;DL6LT is ideal for those who are interested in finding their baseline levels, It is recommended to use this test at regular intervals for continued monitoring to confirm consistency in the readings</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>What Next?</h3>\r\n<p>If you have any results out of the normal range we recommend you consult a doctor just to be sure that everything is ok.</p>\r\n</div>', 'Including Liver and Kidney function, Full blood count, Cholesterol levels, Thyroid, Testosterone', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup>&nbsp;class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '65', 'No', 'in_gm', '43 parameters', 0, 0, 'Active', 'new_custom', 'DL6LT health check', 'DL6LT health check', 'biomarkers for liver and kidney condition,  HBA1C for diabetes and also tests for bone health, gout, iron and testosterone', '1536836706', '1613373375', 1, '', '', '', 'Blood Test', 'no', 'YR018', '0', 'no', '2022-04-13 23:33:32', 9),
(128, 'Full Blood Count', '4', '', 'FBC', 'full-blood-count', '<h3>Information</h3>\r\n<p>The Full Blood Count (FBC) blood test, also known as a Complete Blood Count (CBC) or Haematology Profile, examines the components of blood, including red and white blood cells and platelets.</p>\r\n<div class=\"team-item\">\r\n<h3>Who is this test for?</h3>\r\n<p>This Full Blood Count (FBC) is for individuals who wish to establish the health of their blood. It is an important blood test for&nbsp;people who have symptoms of anaemia or who suspect a viral or bacterial infection.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>What Next?</h3>\r\n<p>If you have any results out of the normal range we recommend you consult a doctor just to be sure that everything is ok.</p>\r\n</div>', 'A full blood count will test both red and white blood cells as well as the clotting status', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup>&nbsp;class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '29', 'No', 'in_gm', '10 Biomarkers, Fingerprick/ Venous', 0, 0, 'Active', 'new_custom', 'Blood Count', 'Blood Count', 'Blood Count', '1536852930', '1615997697', 1, '', '', '', 'Blood Test', 'yes', 'FBC+', '0', 'no', '2022-04-13 23:33:32', NULL),
(129, 'Liver Profile', '4', '', 'LFT', 'liver-profile', '<div class=\"team-item\">\r\n<h3>Information</h3>\r\n<p>Our Liver Profile Check is&nbsp;a comprehensive examination&nbsp;of liver enzymes such as gamma GT and (ALT) which can be elevated&nbsp;if the liver is inflamed or if the biliary system is obstructed.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>Who is this test for?</h3>\r\n<p>As well as for people&nbsp;monitoring an existing&nbsp;liver condition, the Liver Check&nbsp;is designed&nbsp;for those&nbsp;who want to find out if&nbsp;their lifestyle is damaging their liver -&nbsp;particularly if they are worried about&nbsp;excessive alcohol, calorie or drug consumption.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>What Next?</h3>\r\n<p>If you have any results out of the normal range we recommend you consult a doctor just to be sure that everything is ok.</p>\r\n</div>', 'A  liver function test to look for signs of inflammation and damage to the liver which could indicate liver disease.', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup>&nbsp;class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '25', 'No', 'in_gm', 'Fingerprick/Venous, 5 Biomarkers', 0, 0, 'Active', 'new_custom', 'Liver Test', 'Liver Function', '', '1536853779', '1615997733', 1, '', '', '', 'Blood Test', 'no', 'LFT', '0', 'no', '2022-04-13 23:33:32', NULL),
(130, 'Prolactin', '6', '', 'PROl', 'prolactin', '<h3>Information</h3>\r\n<p>Prolactin (PRL), or lactotrope as it is sometimes known, is a protein. It is produced by a small organ at the base of the brain called the anterior pituitary gland. Although found in very low levels in men, prolactin is best known for producing breast milk in females.</p>\r\n<h3>Who is this test for?</h3>\r\n<p>This test is for people looking to find out their prolactin levels.</p>\r\n<h3>What Next?</h3>\r\n<p>If you have any results out of the normal range we recommend you consult a doctor just to be sure that everything is ok</p>', 'A simple blood test that establishes if your levels of prolactin are higher or lower than normal.', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup>&nbsp;class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '29', 'No', 'in_gm', 'Fingerprick/Venous, 1 Biomarker', 0, 0, 'Active', 'new_custom', 'Prolactin', '', '', '1536854185', '1615977718', 1, '', '', '', 'Blood Test', 'yes', 'PROL+', '0', 'no', '2022-04-13 23:33:32', NULL),
