(133, 'Thyroid Detailed', NULL, '', 'YR013', 'thyroid-detailed', '<div class=\"team-item\">\r\n<h3>Information</h3>\r\n<p>Many people begin&nbsp;their investigation into a potential thyroid condition with our Thyroid Detailed. It offers a comprehensive investigation into the main thyroid hormones TSH,&nbsp;FT4 and FT3.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>Who is this test for?</h3>\r\n<p>Many thyroid disorders are caused by an autoimmune disease and your risk for this is raised if you or a family member has a history of autoimmune disease. This test looks for specific thyroid antibodies which can indicate that your thyroid is under attack from your immune system.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>What Next?</h3>\r\n<p>If you have any results out of the normal range we recommend you consult a doctor just to be sure that everything is ok.</p>\r\n</div>', 'Thyroid Detailed offers a comprehensive investigation into the main thyroid hormones TSH, FT4 and FT3. PLUS TP0ab and CRP', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup>&nbsp;class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '80', 'No', 'in_gm', 'Fingerprick/Venous,5 Biomarkers', 0, 0, 'Inactive', 'default', 'Thyroid detailed', 'Thyroid profile', 'Thyroid Detailed. It offers a comprehensive investigation into the main thyroid hormones TSH, FT4 and FT3.', '1536933468', '1615997896', 1, '', '', '', 'Blood Test', 'no', 'YR013', '0', 'no', '2022-04-13 23:33:32', NULL),
(135, 'Testosterone', '6', '', 'TEST', 'testosterone', '<div class=\"team-item\">\r\n<h3>Information</h3>\r\n<p>Testosterone is a sex hormone it is responsible for lots of things including: fat distribution, muscle mass, strength bone mass, sex drive production of sperm and red blood cells</p>\r\n<p>Testosterone levels will decline naturally as we age but sometimes people experience more dramatic drops, this test will check your Testosterone levels</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>Who Can Take The Test?</h3>\r\n<p>It is one of our most popular tests and can be taken by men and women who wish to check their current levels of testosterone.This test is helpful to men who are already receiving Testosterone therapy and would like an exact result with a much higher capped value</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>What Happens Next?</h3>\r\n<p>Using the results of this test along with your personal information you provided a doctor should be able to diagnose and treat anyone with a deficiency in testosterone.</p>\r\n</div>', 'For men and women who wish to check their current levels of testosterone up to 502 nmol/l', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup>&nbsp;class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '29', 'No', 'in_gm', 'Fingerprick/Venous, 1 Biomarker', 0, 0, 'Active', 'new_custom', 'Testosterone', 'It is one of our most popular tests and can be taken by men and women who wish to check their current levels of testosterone.', '', '1539097990', '1615977734', 1, '', '', '', 'Blood Test', 'yes', 'TEST', '0', 'no', '2022-04-13 23:33:32', NULL);
