(139, 'Testosterone Advanced', '6', '', 'YR010', 'Testosterone, Oestriodial SHBG, Albumin & free testosterone', '<div class=\"team-item\">\r\n<h3>Information</h3>\r\n<p>Testosterone is for men and women who wish to check their current levels of testosterone up to 502 nmol/l Also known as an E2 test or Estrogen, Oestriodial is a steroid hormone that accounts for 80% of the oestrogen in the female body.<br />It works hand in hand with Testosterone and although it comes in smaller quantities in a man, it can be affected by changing testosterone levels, This is why this test with both hormones together can be affective for men and women. <br /><br /></p>\r\n<p>Free Testosterone is just as important as Testosterone. It tell you if your body is processing the Testosterone in the most efficient way.&nbsp;</p>\r\n<p>We check the SHBG and Albumin along with your Testosterone and calculate Free Testosterone.&nbsp;</p>\r\n<ul>\r\n<li>Low - free testosterone could show symptoms like: low mood, trouble gaining muscle mass or low libido.&nbsp;</li>\r\n<li>High - free testosterone can effect&nbsp;the production of other hormones.</li>\r\n</ul>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>Who is this test for?</h3>\r\n<p>&nbsp;This is for anyone wanting to get a full advanced picture of testosterone and Oestradiol and how it is being used in your body&nbsp;</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>What Next?</h3>\r\n<p>If you have any results out of the normal range we recommend you consult a doctor just to be sure that everything is ok.</p>\r\n</div>', 'YR010  are hormones that work together in the body, great for men or women looking to monitor their hormones', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup>&nbsp;class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '55', 'No', 'in_gm', '', 0, 0, 'Active', 'default', 'Testosterone, free testosterone and Oestradiol', 'Testosterone, free testosterone and Oestradiol', 'Testosterone free testosterone  and Oestradiol', '1540552513', '1600843960', 1, '', '', '', 'Blood Test', 'yes', 'YR010', '0', 'no', '2022-04-13 23:33:32', NULL),
(143, 'Competitive Athlete', '4', '', 'YR007', 'FBC, HBA1C, Kidney, Liver, Proteins, CRP, IRON, Ferritin, Lipids, thyroid, Vitamins, Hormones, including Free Test + PSA ', '<h3>Information</h3>\r\n<p>Dr Dean St Mart PhD, our industry leading expert pharmacologist has put together a comprehensive blood panel for both natural and enhanced athletes looking to optimise their health and performance.</p>\r\n<p>The test provides a full haemotology analysis including a comprehensive liver, kidney and lipid panel combined with key markers such as hs-CRP and hbA1c to assess inflammation status and blood glucose metabolism. It also provides data on methylation status for active folate and vitamin B12.</p>\r\n<p>On top of all this, it excels in providing in depth endocrinological data towards basal metabolism with a full thyroid hormone and antibody check, morning time cortisol for stress assessment and DHEA-S a marker of</p>\r\n<p>Finally, it offers data on fertility status and natural pituitary function through FSH and LH, female hormone assessment through estradiol, progesterone and prolactin and a high sensitivity testosterone check which goes to an incredible top end range of 502 nmol. Youth-Revisited is proud to offer such an incredibly accessible blood testing service privately for all athletes as well as the general population.</p>', 'Our most popular health MOT test. 55 Bio Markers', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Venous Kit&nbsp;</h3>\r\n<p>We will post out to you a venous pack free of charge; if you know someone that can take your sample from a vein this is all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you don\'t know anyone that can do this for you, please add phlebotomist service in the shopping cart and we can send someone to your house or place of work to take the sample for you and post it to the lab.&nbsp;</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return the sample by 1<sup>st</sup>&nbsp;class post, if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited doctor&rsquo;s laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform we will let you know our thoughts on the results of your test and offer information about having a consultation with the doctor if necessary.</p>\r\n<h3>&nbsp;</h3>\r\n</div>\r\n</div>\r\n</div>', '', '160', 'No', 'in_gm', 'Venous, 54 Biomarkers', 0, 0, 'Active', 'new_custom', 'Competitive Athletes Test', 'Competitive Athletes Test', 'Competitive Athletes Test', '1549436437', '1615977942', 1, '', '', '', 'Blood Test', 'yes', 'YR007', '0', 'no', '2022-04-13 23:33:32', 0),
(149, 'Mental Health', '4', '', 'YR032', 'Test, Oest, FSH, LH, DHEAS, Cortisol, TSH, T4,T3 Free Test, Vit d Vit B12 Zinc, Mag, Ferritin, Iron, CRP  ', '<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>If you are Feeling Anxiety or Depression</p>\r\n<p>The mental health blood test may be able to help</p>\r\n<p>&nbsp;</p>\r\n<p>We can tell so much from a blood test, Low or high levels of hormones or vitamins can have a huge effect on our mental wellbeing and state of mind as well as our physical energy levels.</p>\r\n<p>&nbsp;</p>\r\n<p>Chemical imbalance can happen to anyone at any time for many different reasons. If something is outside the optimal range, you can use that knowledge to fix the issue from its source and not mask it with pills.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>It&rsquo;s hard to know for sure what steps you should take to correctly treat and overcome your depression. The underlying issues that contribute to depression are different for everyone.</p>\r\n<p>&nbsp;</p>\r\n<p>Blood testing can show you the inner functioning of your body, highlight your physiological abnormalities, and help you identify the underlying root causes of your depression so that you can address them using nutrition, supplements, therapies and if needed medication.</p>\r\n<p>&nbsp;</p>\r\n<p>Included in this test are some of the most common connected markers connected with depression. These are equally useful for men and women of all ages.</p>\r\n<p>&nbsp;</p>\r\n<p>Once you receive your results we will also send you an explanation of what the results mean for you and a basic recommendation of how to move forward if your markers are out of range.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Feeling Sad, low mood, anxiety or even depression maybe there is a simple fix Take the mental health blood test', '', '', '149', 'No', 'in_gm', 'Fingerprick/Venous,11 Biomarkers', 0, 0, 'Active', 'new_custom', 'Mental Health', 'Mental health depression anxiety', 'mental health blood test', '1574415348', '1615997835', 1, '', '', '', 'Blood Test', 'no', 'YR032', '0', 'no', '2022-04-13 23:33:32', NULL),
(156, 'Test and Oest', '6', '', 'YR008', 'test-and-oest', '<p>Testosterone and Oestriodial&nbsp;</p>', 'Testosterone & Oestradiol', '', '', '49', 'No', 'in_gm', '', 0, 0, 'Active', 'new_custom', '', '', '', '1592135186', '1614094104', 1, '', '', '', 'Blood Test', 'yes', 'YR008', '0', 'no', '2022-04-13 23:33:32', NULL),
(158, 'Iron Profile', NULL, '', 'YR028', 'iron-profile', '<p>Iron Profile&nbsp;</p>\r\n<p>including Ferritin Iron Transferin and TIBC&nbsp;</p>', 'Iron Profile checks for all essential biomarkers connected to iron and its function around the body', '', '', '35', 'No', 'in_gm', 'Fingerprick/Venous,x Biomarkers', 0, 0, 'Active', 'new_custom', '', '', '', '1596181718', '1620727613', 1, '', '', '', 'Blood Test', 'yes', 'YR028', '0', 'no', '2022-04-13 23:33:32', NULL),
(160, 'Prostate Check', '4', '', 'PSA', 'prostate-check', '<p>This blood test measures the level of PSA (prostate specific antigen) in the blood.</p>', 'This blood test measures the level of PSA (prostate specific antigen) in the blood.', '', '', '29', 'No', 'in_gm', 'Fingerprick/Venous, 1 Biomarker', 0, 0, 'Active', 'new_custom', 'PSA', 'PSA', 'PSA', '1602837283', '1615977839', 1, '', '', '', 'Blood Test', 'yes', 'PSA', '0', 'no', '2022-04-13 23:33:32', NULL),
(161, 'HbA1c', '4', '', 'HBA1C', 'hba1c', '<p>For people without&nbsp;<strong>diabetes</strong>, the normal range for the hemoglobin A1c level is between 4% and 5.6%. Hemoglobin A1c levels between 5.7% and 6.4% mean you have a higher chance of getting&nbsp;<strong>diabetes</strong>. Levels of 6.5% or higher mean you have&nbsp;<strong>diabetes</strong></p>\r\n<p>&nbsp;</p>\r\n<h2>What is HbA1c?</h2>\r\n<p>The term&nbsp;<em>HbA1c&nbsp;</em>refers to glycated haemoglobin. It develops when haemoglobin, a protein within red blood cells that carries oxygen throughout your body, joins with glucose in the blood, becoming &lsquo;glycated&rsquo;.</p>\r\n<p>By measuring glycated haemoglobin (HbA1c), clinicians are able to get an overall picture of what our average blood sugar levels have been over a period of weeks/months.</p>\r\n<p>&nbsp;</p>\r\n<p>When the body processes sugar, glucose in the bloodstream naturally attaches to haemoglobin.</p>\r\n<p>The amount of glucose that combines with this protein is directly proportional to the total amount of sugar that is in your system at that time.</p>\r\n<p>Because red blood cells in the human body survive for 8-12 weeks before renewal, measuring glycated haemoglobin (or HbA1c) can be used to reflect average blood glucose levels over that duration, providing a useful longer-term gauge of blood glucose control.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Haemoglobin (HbA1c), By measuring this biomarker clinicians are able to get an overall picture of what our average blood sugar levels have been over a period of weeks/months.Ideal if you have issues with Blood sugar or are Diabetic', '', '', '29', 'No', 'in_gm', 'Fingerprick/ Venous,1 Biomarker', 0, 0, 'Active', 'new_custom', 'HbA1c', 'HbA1c, Blood test. diabetes health finger prick', 'HbA1c', '1602837517', '1615977644', 1, '', '', '', 'Blood Test', 'yes', 'HbA1c', '0', 'no', '2022-04-13 23:33:32', NULL),
(162, 'CRP', '11', '', 'CRP', 'CRP', '<p>Inflammation occurs when your defence system is activated</p>\r\n<p>Typical signs of inflammation include heat, redness, swelling and pain.</p>\r\n<ul>\r\n<li>Acute inflammation is often caused by infection or injury, and it flares up and disappears within days.</li>\r\n<li>Chronic inflammation is caused by longer-term conditions such as arthritis, inflammatory bowel disease or asthma.</li>\r\n<li>Inflammation causes levels of certain proteins in the blood to rise and these can be measured to assess the extent of inflammation as well as in some instances the cause.</li>\r\n</ul>', 'CRP Inflammation, this is raised when the body is fighting something infection, injury or illness.', '', '', '29', 'No', 'in_gm', 'Fingerprick/Venous, 1 Biomarker', 0, 0, 'Active', 'new_custom', 'crp', 'crp', 'crp', '1603974596', '1615998488', 1, '', '', '', 'Blood Test', 'yes', 'CRP+', '0', 'no', '2022-04-13 23:33:32', NULL),
(163, 'Vitamin B12', '5', '', 'B12', 'vitamin-b12', '<p>Vitamin B12 is part of the B complex of vitamins</p>\r\n<p>If you&rsquo;re feeling tired and fatigued a B12 deficiency could explain why.&nbsp;</p>\r\n<p>The body is unable to make this vitamin itself and so instead takes it in through diet</p>\r\n<p>&nbsp;</p>\r\n<p>Vitamin B12 plays a key role in several of our physiological functions.&nbsp;</p>\r\n<p>Vitamin B12 can only be derived from animal sources such as meat, fish and dairy.</p>\r\n<p>Deficiency can be common amongst the vegan and/or vegetarian community.</p>\r\n<p>supplements may be needed to keep levels optimum.&nbsp;</p>\r\n<p>Pregnant women require increased B12 Older people can&nbsp;also be susceptible</p>\r\n<p>An at home B12 test will give you a quick and accurate measurement.</p>\r\n<p>&nbsp;</p>', 'Vitamin B12 is an essential vitamin for your body, Low levels cause fatigue, If youre feeling tired and weak a vitamin B12 test might explain why.', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return your sample. if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform.</p>\r\n</div>\r\n</div>\r\n</div>', '', '39', 'No', 'in_gm', '1 Biomarker, Finger/venous kit', 0, 0, 'Active', 'new_custom', 'Vitamin B12', 'Vitamin B12 blood test', 'Vitamin B12, vitamins, health, blood test, deficiency, health, fitness, wellness, nutrition, finger prick kits, labs, blood,', '1603974626', '1614684712', 1, '', '', '', 'Blood Test', 'yes', 'B12+', '0', 'no', '2022-04-13 23:33:32', NULL),
(165, 'Liver Function test', '4', '', 'YR022', 'Billirubin, ALK, ALT, CK, Gamma GT', '<p>Liver function&nbsp;</p>', 'liver function test', '', '', '15', 'No', 'in_gm', '', 0, 0, 'Active', 'default', 'liver function', 'liver function', 'liver function', '1605600481', '1605622428', 1, '', '', '', 'Blood Test', 'yes', 'LFT', '0', 'no', '2022-04-13 23:33:32', NULL),
(166, 'Vitamin D', '5', '', 'VIT D', 'vitamin-d', '<p>Vitamin D is needed by the body to regulate the amount of calcium and phosphate in the body.</p>\r\n<p>It is essential for bone, tooth and muscle health</p>\r\n<p>There are two ways to gain vitamin D:</p>\r\n<ol>\r\n<li>It is produced in the skin following exposure to sunlight</li>\r\n<li>Taken in through the diet via food and supplements</li>\r\n</ol>\r\n<p>Vitamin D is needed by the body. it has a key role in maintaining bone health as well as the proper functioning of our&nbsp;</p>\r\n<p>Some Symptoms of a vitamin D Deficiency are listed below.&nbsp;</p>\r\n<ul>\r\n<li>Bone pain</li>\r\n<li>Muscle pain</li>\r\n<li>Muscle cramps</li>\r\n<li>Fractures</li>\r\n<li>Fatigue</li>\r\n<li>Recurrent infections</li>\r\n<li>Hair loss</li>\r\n<li>Depression</li>\r\n</ul>', 'Vitamin D3 (25 0H) Helps to maintain our immune system, muscle function, energy levels and helps to reduce inflammation', '<div class=\"col-md-6  rightBorderMD\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Finger prick Pack</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 fadeInUp animated rightBorderMD go\">\r\n<div class=\"col-md-12\">\r\n<div class=\"team-item\">\r\n<h3>Postage</h3>\r\n<p>Your kit will have a self-addressed envelope enclosed to return your sample.&nbsp;if you are unsure of the level of service in your area you may wish to upgrade to a guaranteed next day service.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>The Lab</h3>\r\n<p>Your blood sample will be analysed at the accredited laboratory in London. They are very professional and quick to upload the data; your results should be ready the same day they are tested.</p>\r\n<h3>Results</h3>\r\n<p>Once your results are uploaded on your bespoke platform.</p>\r\n</div>\r\n</div>\r\n</div>', '', '39', 'No', 'in_gm', '1 Biomarker , Finger/venous kit', 0, 0, 'Active', 'new_custom', 'Vitamin D Blood test', 'VIT D', 'Vitamin d, vitamins, health, blood test, deficiency, health, fitness, wellness, nutrition, finger prick kits, labs, blood,', '1605719569', '1614684697', 1, '', '', '', 'Blood Test', 'yes', 'VITD', '0', 'no', '2022-04-13 23:33:32', NULL),
