(168, 'Nutricheck', '5', '', 'YRVIT', 'Vitamins D,  B12, Folate  Iron Ferritin, TIBC, Transferrin Sat Magnesium', '<p>Vitamins and minerals play a key part in our overall health and wellbeing&nbsp;</p>\r\n<p>Sometimes these markers can become depleted though a busy lifestyle diet and nutritional factors&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Some symptoms connected to this are:&nbsp;</p>\r\n<ul>\r\n<li>&nbsp;Fatigue&nbsp;</li>\r\n<li>Anaemia&nbsp;</li>\r\n<li>Depression,&nbsp;</li>\r\n<li>Muscle aches</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>This test is suitable for men and women of any age that are looking to check their vitamin and nutrition levels.&nbsp;</p>\r\n<p>and is especially useful for vegan or vegetarians as some of these vitamins are mainly sourced in animal products</p>\r\n<p>Especially because some Vitamins can only be sourced from animal sources such as meat, fish and dairy this test could be helpful for the vegan and/or vegetarian community.&nbsp;</p>', 'Essential Vitamin and mineral check Checks for: Vitamins D,  B12, Folate  Iron Ferritin, TIBC, Transferrin Sat Magnesium', '<h3>AT HOME FINGER PRICK KIT</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>', '<p>x</p>', '79', 'No', 'in_gm', '8 Biomarkers, Finger/venous kit', 0, 0, 'Active', 'new_custom', 'Vitamin blood test', 'Vitamin Package', 'Vitamin Package, nutrition, deficiency, vegan test, blood test, check levels, health, minerals, iron, anaemia,', '1608293569', '1614260853', 1, '', '', '', 'Blood Test', 'yes', 'YRVIT', '0', 'no', '2022-04-13 23:33:32', NULL),
(170, 'Fertility Test', '7', '', 'YR052', 'AMH, FSH, OEST, LH, PROLACTIN, PROGESTERONE, TESTOSTERONE ', '<div class=\"product-biomarkers__item__desc\"><strong>Information&nbsp;</strong></div>\r\n<div class=\"product-biomarkers__item__desc\">Hormones are a vital part of our everyday functions, they influence all parts of our growth reproduction, sleep, moods, metabolism.&nbsp;Any imbalance can have a huge impact on the way we feel.&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">One of the areas governed by hormones is the reproductive cycle.&nbsp; People trying to start a family, if you are working with a specialist they may ask for the information on this test when making an assessment.&nbsp; &nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">Hormone levels fluctuate through your cycle, so knowing when to take this test is also important.</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\"><strong>Who is this test for</strong></div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">\r\n<p class=\"lead\">The Fertility test is for anyone who is curious about their fertility status. If you want to find out how many eggs you have left</p>\r\n<p class=\"lead\">You could have the test if you are thinking about having IVF, this test can give you an indication of how you are likely to respond to treatment.</p>\r\n</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\"><strong>Notes for this test&nbsp;</strong></div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">Take this test between days 2 and 5 of your period.</div>\r\n<div class=\"product-biomarkers__item__desc\">It can be taken at any time if you are not having periods.</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">HRT and the contraceptive pill can affect the results of this test, taking the test during a break from these will give more accurate results. Avoid taking a finger-prick sample from a finger used to handle hormone-gels or hormone-pessaries in the past 4 weeks.</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">Do not take biotin supplements for 2 days prior to this test.</div>\r\n<div class=\"product-biomarkers__item__desc\">If you are taking prescribed biotin you should discuss this with your doctor.</div>\r\n<div class=\"product-biomarkers__item__desc\">Please let us know if you have polycystic ovarian syndrome, as this can affect the results of this test</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\"><strong>After your test&nbsp;</strong></div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">Once you have your results if needed we can direct you to someone that can explain them to you and offer a more detailed analysis&nbsp;</div>\r\n<div class=\"product-biomarkers__item__desc\">&nbsp;</div>', 'AMH, FSH, OEST, LH, PROLACTIN, PROGESTERONE, TESTOSTERONE ', '<h3>FINGER PRICK PACK</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>', '', '160', 'No', 'in_gm', 'Fingerprick/Venous, 7 Biomarkers', 0, 0, 'Active', 'new_custom', 'Fertility', 'Fertility', 'Fertility AMH', '1611228516', '1615997800', 1, '', '', '', 'Blood Test', 'yes', 'YR052', '0', 'no', '2022-04-13 23:33:32', NULL),
(171, 'Kidney Check', '4', '', 'YR023', ' Urea, EGFR, Creatinine, albumin, sodium total protein, Globulin', '<div class=\"product-biomarkers__item__desc\">Your kidneys are responsible for removing waste products and excess fluid from your blood. How well they are doing their job can be measured by examining the levels of waste product in the blood as well as levels of electrolytes which regulate fluid in the body.</div>\r\n<div class=\"product-biomarkers__item__desc\">Kidney disease has few symptoms in the early stages so it is important to monitor kidney function, especially if you are a diabetic, have raised blood pressure or a close relative with the disease.</div>', 'Kidney Checks include Urea, EGFR, Creatinine, albumin, sodium total protein, Globulin', '<h3>FINGER PRICK PACK</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>', '', '29', 'No', 'in_gm', 'Fingerprick/Venous,7 Biomarkers', 0, 0, 'Active', 'new_custom', '', '', '', '1611754782', '1620726719', 1, '', '', '', 'Blood Test', 'yes', 'YR023', '0', 'no', '2022-04-13 23:33:32', NULL),
(172, 'Male Hormone Essential', '6', '', 'YR033', 'Testosterone, Oestriodial, Prolactin', '<p>Essential male hormones Testosterone, Oestriodial, Prolactin&nbsp;</p>', 'Testosterone, Oestriodial, Prolactin', '', '', '70', 'No', 'in_gm', 'fingerprick/Venous, 3 biomarkers', 0, 0, 'Active', 'new_custom', '', '', '', '1613999787', '1614668997', 1, '', '', '', 'Blood Test', 'yes', 'YR033', '0', 'no', '2022-04-13 23:33:32', NULL),
(173, 'Ceruloplasmin', '4', '', 'ceruloplasmin', 'ceruloplasmin', '<p>Ceruloplasmin</p>', 'Ceruloplasmin', '', '', '80', 'No', 'in_gm', '', 0, 0, 'Active', 'new_custom', 'Ceruloplasmin', 'Ceruloplasmin', '', '1614008456', '1614346509', 1, '', '', '', 'Blood Test', 'yes', '', '0', 'no', '2022-04-13 23:33:32', NULL),
(174, 'Female Hormone Advanced', '7', '', 'YRFHP', 'FSH, Oest, prolactin, LH,  + Thyroid   TSH T4 T3', '<div class=\"team-item\">\r\n<p>The basic womens profile test will take a glimpse at all your essential hormone markers including Follicle Stimulating Hormone, important for women in the production of eggs&nbsp; oestrodial&nbsp; levels which can be the cause of can cause acne, constipation loss of sex drive and depression and Progesterone it helps prepare your body for conception and pregnancy and regulates the monthly menstrual cycle. It also plays a role in sexual desire</p>\r\n<p>&nbsp;</p>\r\n<p>By having the Advanced test is also included 3 of the main Thyroid markers FSH FT4 &amp; FT3 these makers are key function of your body. typically an underactive thyroid leads to symptoms of lethargy, weight gain and dry skin and hair while an overactive thyroid leads to symptoms of feeling nervous and anxious, as well as weight loss.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>WHO IS THIS TEST FOR?</h3>\r\n<p>The general health check is designed for women of any age, It is a good starting point for young and old for establishing base levels for many important health markers.</p>\r\n</div>\r\n<div class=\"team-item\">\r\n<h3>WHAT NEXT</h3>\r\n<p>If you have any results out of the normal range we recommend you consult a doctor just to be sure that everything is ok.</p>\r\n<p>If you have any questions or queries relating to this we recommend you consult a doctor for further assistance</p>\r\n</div>', 'FSH, Oest, prolactin, LH,  + Thyroid   TSH T4 T3 ', '', '', '95', 'No', 'in_gm', 'Fingerprick/ Venous, 7 biomarkers', 0, 0, 'Active', 'new_custom', 'female hormone advanced', 'female hormone advanced', 'female hormone advanced', '1614165717', '1614267252', 1, '', '', '', 'Blood Test', 'yes', 'YRFHP', '0', 'no', '2022-04-13 23:33:32', NULL),
(175, 'Male Hormone Advanced', '6', '', 'YRMHP', 'Testosterone, Oestriodial, Prolactin, Free Testosterone Thyroid and Cortisol', '<p>Male Hormone Advanced&nbsp;</p>\r\n<p>The male hormone profile&nbsp;is a test for key markers in your blood to help you monitor and manage your hormones.&nbsp; Whilst testosterone can have a positive impact on strength, libido, sexual performance and mood, there are also risks to your health, especially if taken to excess.</p>\r\n<p>The Advanced Male Hormone test looks at the main hormones plus&nbsp;</p>\r\n<p>Thyroid connected to metabolism and lethargy, TSH AND FT4 are essential hormones in the body</p>\r\n<p>CRP this is an inflammation marker and valuable if you have had any injuries or strain on your body that it may be fighting.&nbsp;</p>', 'Male Hormone Advanced Testosterone, Oestriodial, Prolactin, Free Testosterone Thyroid and Cortisol', '', '', '135', 'No', 'in_gm', 'Fingerprick/ Venous , xx Biomarkers', 0, 0, 'Active', 'new_custom', 'Male Hormone Advanced', 'Male Hormone Advanced', 'Male Hormone Advanced', '1614174394', '1615795263', 1, '', '', '', 'Blood Test', 'yes', 'YRMHP', '0', 'no', '2022-04-13 23:33:32', NULL),
(176, 'Vitality', '5', '', 'YRVITALITY', 'B12, D3, Iron, ferritin, tibc Transferrin Sat, Cholesterol CRP, Magnesium and Folate.', '<p>Vitality test will check your body\'s levels of key vitamins and minerals, vital for optimising you health and supporting your body.&nbsp;</p>\r\n<p>This includes all key markers such as B12, D3, Iron, Cholesterol and Folate.&nbsp;</p>', 'B12, D3, Iron, ferritin, tibc Transferrin Sat, Cholesterol CRP, Magnesium and Folate.', '', '', '99', 'No', 'in_gm', 'Fingerprick/Venous, 13 Biomarkers', 0, 0, 'Active', 'new_custom', 'Vitality', 'Vitality, Vitamins, B12, D, Iron, Minerals, Cholesterol,', 'Vitality Test, Blood test, Vitality, Vitamins, B12, D, Iron, Minerals, Cholesterol,', '1614257165', '1614260757', 1, '', '', '', 'Blood Test', 'yes', 'YRVITALITY', '0', 'no', '2022-04-13 23:33:32', NULL),
(177, 'Omega 3 & 6', '5', '', 'OMEGA', 'omega-3-and-6', '<div class=\"col-md-6\">\r\n<p>Omega 6 and 3 are essential fatty acids which the body is unable to make itself. Checking these&nbsp;levels will help you to find out if there is too much saturated fat in your diet.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<p>&nbsp;</p>\r\n</div>', 'Omega 6 and omega 3 are essential fatty acidsThey are a form of dietary fat and are found in abundance in oily fish.', '', '', '99', 'No', 'in_gm', 'Finger/Venous, 1 Biomarker', 0, 0, 'Active', 'new_custom', 'Omega 3 & 6', 'Omega 3 & 6', 'Omega 3 & 6, fatty acids, good fats, saturated fats, vitamins, health, blood test,', '1614258548', '1615896363', 1, '', '', '', 'Blood Test', 'yes', 'YROMEGA', '0', 'no', '2022-04-13 23:33:32', NULL),
(178, 'Infection Profile 1', '8', '', 'YR045', 'infection-profile-1', '<p>Chlamydia and Gonorrhoea are the two most common STIs.</p>\r\n<p>Both infections can be symptomless and the only way to detect them is with a test.</p>\r\n<p>Early detection is crucial in reducing any long term consequences</p>\r\n<h2 class=\"h3\">&nbsp;</h2>\r\n<h2 class=\"h3\">Symptoms of sexually transmitted infections may include:</h2>\r\n<ul class=\"blue-dots\">\r\n<li>Painful urination</li>\r\n<li>Pain during sexual intercourse</li>\r\n<li>Rash on the genitals and/or anus</li>\r\n<li>Itching or irritation on the genitals and/or anus</li>\r\n<li>Unusual lumps or bumps around the genitals and/or anus</li>\r\n<li>Change in colour of the male or female discharge</li>\r\n<li>Abnormal discharge in terms of smell, consistency or volume</li>\r\n<li>Strong vaginal odour</li>\r\n<li>Painful erections</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"biomarkers\">\r\n<li>\r\n<h2 class=\"h3\">Chlamydia</h2>\r\n<p>Chlamydia is an infection caused by the bacterium Chlamydia trachomatis. Chlamydia can be contracted through sexual contact and generally shows no symptoms.</p>\r\n</li>\r\n<li>\r\n<h2 class=\"h3\">Gonorrhoea</h2>\r\n<p>Gonorrhoea is a bacterial infection caused by the bacterium Neisseria gonorrhoeae. It is transmitted through sexual contact and most commonly causes a yellowish discharge in men and is asymptomatic in women.</p>\r\n</li>\r\n</ul>\r\n<h3>&nbsp;</h3>\r\n<h3><strong>When to take a test</strong></h3>\r\n<p>STIs can take a period of time to become detectable. This is called the window period. You should wait at least 2 weeks from the time of potential exposure to infection before taking this test.</p>', 'Chlamydia and Gonorrhoea are the two most common STIs.Both infections can be symptomless and the only way to detect them is with a test.Early detection is crucial in reducing any long term consequences', '<p>Urine Sample&nbsp;</p>', '', '79', 'No', 'in_gm', 'Urine sample, 2 Infection markers', 0, 0, 'Active', 'new_custom', 'Chlamydia & Gonorrhoea', 'Chlamydia & Gonorrhoea', 'Chlamydia & Gonorrhoea', '1614268010', '1615896448', 1, '', '', '', 'Blood Test', 'yes', 'YR045', '0', 'no', '2022-04-13 23:33:32', NULL),
(179, 'Infection Profile 2', '8', '', 'YR046', 'infection-profile-2', '<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Long term consequences of untreated infection can be:&nbsp;</p>\r\n<p>such as pelvic inflammatory disease, ectopic pregnancy, chronic pelvic pain, infertility in women and epididymitis, which causes infertility in men by inflaming the reproductive tubes.</p>\r\n<p>&nbsp;</p>\r\n<h2 class=\"h3\">Symptoms of sexually transmitted infections may include:</h2>\r\n<ul class=\"blue-dots\">\r\n<li>Painful urination</li>\r\n<li>Pain during sexual intercourse</li>\r\n<li>Rash on the genitals and/or anus</li>\r\n<li>Itching or irritation on the genitals and/or anus</li>\r\n<li>Unusual lumps or bumps around the genitals and/or anus</li>\r\n<li>Change in colour of the male or female discharge</li>\r\n<li>Abnormal discharge in terms of smell, consistency or volume</li>\r\n<li>Strong vaginal odour</li>\r\n<li>Painful erections</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>STIs can take time to show on a test. You should wait at least 4 weeks from the time of potential exposure to infection before taking this test.</p>\r\n<ul class=\"biomarkers\">\r\n<li>\r\n<h2 class=\"h3\">Chlamydia</h2>\r\n<p>Chlamydia is an infection caused by the bacterium Chlamydia trachomatis. Chlamydia can be contracted through sexual contact and generally shows no symptoms.</p>\r\n</li>\r\n<li>\r\n<h2 class=\"h3\">Gonorrhoea</h2>\r\n<p>Gonorrhoea is a bacterial infection caused by the bacterium Neisseria gonorrhoeae. It is transmitted through sexual contact and most commonly causes a yellowish discharge in men and is asymptomatic in women.</p>\r\n</li>\r\n<li>\r\n<h2 class=\"h3\">Trichomoniasis</h2>\r\n<p>Trichomoniasis is caused by infection with the protozoan parasite Trichomonas vaginalis and is transmitted through sexual contact. Trichomoniasis is often responsible for a green or frothy discharge in men and women.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'Chlamydia, gonorrhoea, and trichomoniasis are three of the most common STIs. They are often symptomless and early detection is crucial to avoid long-term consequences', '<p>Urine sample&nbsp;</p>', '', '120', 'No', 'in_gm', 'Urine sample, 3 Infection markers', 0, 0, 'Active', 'new_custom', 'Chlamydia, gonorrhoea, and trichomoniasis', 'Chlamydia, gonorrhoea, and trichomoniasis', 'Chlamydia, gonorrhoea, and trichomoniasis', '1614268303', '1615896470', 1, '', '', '', 'Blood Test', 'yes', 'YR046', '0', 'no', '2022-04-13 23:33:32', NULL),
(180, 'Infection Profile 3', '8', '', 'YR047', 'infection-profile-3', '<p>&nbsp;</p>\r\n<p>This is our most comprehensive and most popular Infection Test.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ul class=\"biomarkers\">\r\n<li>Symptoms of sexually transmitted infections may include:</li>\r\n</ul>\r\n<ul class=\"blue-dots\">\r\n<li>Painful urination</li>\r\n<li>Pain during sexual intercourse</li>\r\n<li>Rash on the genitals and/or anus</li>\r\n<li>Itching or irritation on the genitals and/or anus</li>\r\n<li>Unusual lumps or bumps around the genitals and/or anus</li>\r\n<li>Change in colour of the male or female discharge</li>\r\n<li>Abnormal discharge in terms of smell, consistency or volume</li>\r\n<li>Strong vaginal odour</li>\r\n<li>Painful erections</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"lead\">STIs can take a period of time to become detectable. You should wait at least 4 weeks from the time of potential exposure to infection before taking this test.</p>\r\n<p class=\"lead\">Please note that syphilis and hepatitis B can take 12 weeks to become detectable. If you are concerned about these infections, you should wait at least 12 weeks from the time of potential exposure before taking this test.</p>', 'Chlamydia Gonorrhoea TrichomoniasisHIV (I, II, P24 antigen) SyphilisHepatitis B', '<p>Urine Sample&nbsp;</p>', '', '140', 'No', 'in_gm', 'Urine Sample,fingerprick sample,6 Health markers', 0, 0, 'Active', 'new_custom', 'Chlamydia Gonorrhoea Trichomoniasis HIV (I, II, P24 antigen) Syphilis Hepatitis B', 'Chlamydia Gonorrhoea Trichomoniasis HIV (I, II, P24 antigen) Syphilis Hepatitis B', 'Chlamydia Gonorrhoea Trichomoniasis HIV (I, II, P24 antigen) Syphilis Hepatitis B', '1614268576', '1615896485', 1, '', '', '', 'Blood Test', 'yes', 'YR047', '0', 'no', '2022-04-13 23:33:32', NULL),
(181, 'EPP Test', '8', '', 'YR049', 'Exposure Prone Procedures (EPP) HIV, Measles, Rubella, Varicella, Hepatitis C, Hepatitis B Surface Antigen Hep B Surface Antibody', '<p>This EPP approved immunity blood test profile includes:</p>\r\n<p>HIV, Measles, Rubella, Varicella, Hepatitis C,&nbsp;</p>\r\n<p>Hepatitis B Surface Antigen (HBsAg), Hep B Surface Antibody (anti-HBs)</p>\r\n<p>&nbsp;</p>\r\n<p>Ideal for anyone returning to work that may need an up to date EPP Test.&nbsp;</p>\r\n<p>&nbsp;</p>', 'Exposure Prone Procedures (EPP) HIV, Measles, Rubella, Varicella, Hepatitis C, Hepatitis B Surface Antigen Hep B Surface Antibody', '', '', '90', 'No', 'in_gm', 'Fingerprick/Venous, 7 Infection markers', 0, 0, 'Active', 'new_custom', '', '', '', '1614269416', '1615896511', 1, '', '', '', 'Blood Test', 'yes', 'YR049', '0', 'no', '2022-04-13 23:33:32', NULL),
(183, 'Vitamins', '5', '', 'YR030', 'Vitamins b12, Active B12 & Vit D ', '<p>Vitamin B12 is part of the B complex of vitamins</p>\r\n<p>If you&rsquo;re feeling tired and fatigued a B12 deficiency could explain why.&nbsp;</p>\r\n<p>The body is unable to make this vitamin itself and so instead takes it in through diet</p>\r\n<p>&nbsp;</p>\r\n<p>Active Vitamin B12&nbsp;</p>\r\n<p>Shows the difference between the total B12 in your body and the amount that is being activley used.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Vitamin D is needed by the body to regulate the amount of calcium and phosphate in the body.</p>\r\n<p>It is essential for bone, tooth and muscle health</p>', 'B12, Active B12 and Vitamin D Essential Vitamins', '<h3>FINGER PRICK PACK</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>', '', '69', 'No', 'in_gm', 'Fingerprick/Venous, 3 Biomarkers', 0, 0, 'Active', 'new_custom', 'B12, Active B12 and Vitamin D', 'B12, Active B12 and Vitamin D', 'B12, Active B12 and Vitamin D', '1615806975', '1615998794', 1, '', '', '', 'Blood Test', 'yes', 'YR030', '0', 'no', '2022-04-13 23:33:32', NULL),
