(192, 'Iron', '10', '', 'IRON+', 'iron', '<p><span style=\"font-weight: 400;\">Iron Test added by developer</span></p>', 'This test measures Iron level. Iron is important in making red blood cells, which carry oxygen around the body.', '', '', '5', 'No', 'in_gm', '', 0, 0, 'Active', 'default', 'Iron', 'Iron', 'Iron', '1617861236', '1620723279', 1, '', '', '', 'Blood Test', 'yes', 'IRON', '0', 'yes', '2022-04-13 23:33:32', NULL),
