(202, 'Prolactin', '10', '', 'PROL+', 'prolactin', '<div class=\"sec-title mb20\">\r\n<h2>PROLACTIN</h2>\r\n</div>\r\n<h3>INFORMATION</h3>\r\n<p>Prolactin (PRL), or lactotrope as it is sometimes known, is a protein. It is produced by a small organ at the base of the brain called the anterior pituitary gland. Although found in very low levels in men, prolactin is best known for producing breast milk in females.</p>\r\n<h3>WHO IS THIS TEST FOR?</h3>\r\n<p>This test is for people looking to find out their prolactin levels.</p>\r\n<h3>WHAT NEXT?</h3>\r\n<p>If you have any results out of the normal range we recommend you consult a doctor just to be sure that everything is ok</p>', 'A simple blood test that establishes if your levels of prolactin are higher or lower than normal.', '<h3>FINGER PRICK PACK</h3>\r\n<p>We will post out to you a finger prick sample pack; it will have all you need to take your sample including instructions of how to take the sample and an envelope to return it to the Lab.</p>\r\n<p>If you are nervous or unsure about anything please contact us and we will do our best to help.</p>\r\n<p>We always recommend taking your sample in the morning and getting to the post office the same day.</p>', '', '20', 'No', 'in_gm', '', 0, 0, 'Active', 'default', 'Prolactin', 'Prolactin', 'Prolactin', '1617867047', '1620295349', 1, '', '', '', 'Blood Test', 'yes', 'PROL+', '0', 'yes', '2022-04-13 23:33:32', NULL),
(203, 'Progesterone', '10', '', 'PROG+', 'progesterone', '<p><span style=\"font-weight: 400;\">Progesterone test added by developer</span></p>', 'This Test measures the amount of Progesterone in your blood it is a female hormone produced by the ovaries...', '', '', '20', 'No', 'in_gm', '', 0, 0, 'Active', 'default', 'Progesterone', 'Progesterone', 'Progesterone', '1617867119', '1620725324', 1, '', '', '', 'Blood Test', 'yes', 'PROG+', '0', 'yes', '2022-04-13 23:33:32', NULL);
